// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;
//pragma solidity 0.4.25;

contract ReturnValue {

    string msg1;
    event callcheck(address from, address to, uint amount);

  function callchecked(address callee) public{
    require(callee.call(), "callee.call Fail");
    emit callcheck(msg.sender, callee, msg.sender.balance);
  }

  function callchecked_return(address callee) public returns(bool) {
    require(callee.call(), "callee.call Fail (return)");
    emit callcheck(msg.sender, callee, msg.sender.balance);
    return callee.call();
  }
  function callnotchecked(address callee) public {
    callee.call();
    msg.sender.transfer(this.balance);
  }

  function sendcall(address callee) public {
    callee.send(10000000000); //callee로 값 만큼 전송
    address(this).balance;
  }

  function a() payable{}
}
